source:
// SPDX-License-Identifier: GPL-3.0
pragma solidity =0.8.13;

struct Code {
    string code;
    string display;
    string system;
}

struct Coding {
    string code;
    string display;
    string definition;
}
struct Value {
    Code coding;
}
struct Nacionalidad {
    string url;
    Value Value;
}
struct Type {
    Coding paises;
    Coding coding;
}
struct Identifier {
    string use;
    Type paises;
    string value;
}

struct Family {
    string segundoApellido;
}

struct NombreOficial {
    string use;
    Family family;
    string given;
}

struct NombreSocial {
    string use;
    string given;
}

struct Telecom {
    Code system;
    string value;
    Code use;
}

struct PatientAddress {
    Code country;
    string city;
    string street;
    string postalCode;
    string number;
}

struct Name {
    string use;
    Family family;
    string given;
}
struct Contact {
    string IdContacto;
    Coding relationship;
    Name name;
}

struct Lenguage {
    Coding coding;
}
struct Communication {
    Lenguage lenguage;
}

struct GeneralPractitioner {
    string id;
    string Reference;
    string display;
}

struct patientData {
    Code identidadDeGenero;
    Coding sexoBiologico;
    Nacionalidad nacionalidad;
    Identifier identifier;
    NombreOficial nombreOficial;
    NombreSocial nombreSocial;
    Telecom telecom;
    string birthDate;
    PatientAddress patientAddress;
    Contact contact;
    Communication communication;
    GeneralPractitioner generalPractitioner;
}

contract paciente {
    patientData[] public pacientes;
    mapping(address => patientData) public patientDataToAddress;

    function updatePatientData(patientData calldata _patientData) public {
        patientDataToAddress[msg.sender] = _patientData;
    }
}
